using SeedExtraProperties;

var client = new SeedExtraPropertiesClient();
await client.User.CreateUserAsync(
    new CreateUserRequest
    {
        Name = "Alice",
        Type = "CreateUserRequest",
        Version = "v1",
        AdditionalProperties = new AdditionalProperties
        {
            ["age"] = 30,
            ["location"] = "Wonderland",
        },
    }
);
